import React from "react";
import "./Navbar.css";
import logo from "./images/logoimg.png";
import callicon from "./images/support.svg";

const Navbar = () => {
  return (
    <div>
      <div className="container logovscall">
        <div className="row">
          <div className="col-sm-12 col-md-7 col-lg-8 logodiv">
            <img src={logo} />
            <p>
              FIZMA<span className="spanfor_soft">SOFT</span>
            </p>
          </div>
          <div className="col-sm-8 col-md-5 col-lg-4 d-sm-none d-md-block">
            <div className="row call_section  ">
              <img className="call_icon mr-2" src={callicon} />
              <p className="call_num mt-2">(90)777 77 07</p>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Navbar;
